import React, { useState, useEffect } from "react";

function VirtualNin() {
  const [responseData, setResponseData] = useState(null);
  const endpointUrl =
    "https://tk.nimc.gov.ng/api/v1/apiVerification/enterprise/direct/vNIN";

  const corsAnywhereUrl = "https://cors-anywhere.herokuapp.com/";
  const apiKey = "dgmP5YTlXyYy7SGGzjJKL5nj3f&Le%Pmxxnh&nbn";
  const agentID = "MQSSKY-4549";
  const RPShortCode = "119887";
  const vNIN = "JR855898754235V5";
  useEffect(() => {
    async function callApi() {
      try {
        const requestOptions = {
          method: "POST",

          headers: { "Content-Type": "application/x-www-form-urlencoded" },
          body: new URLSearchParams({
            agentID,
            RPShortCode,
            vNIN,
          }),
        };
        const response = await fetch(endpointUrl, requestOptions);
        console.log(response);
        const data = await response.json();
        console.log(data);
        setResponseData(data.photograph);
      } catch (error) {
        console.log(`theis is the error:`, error);
      }
    }
    callApi();
  }, [endpointUrl, apiKey, agentID, RPShortCode, vNIN]);
  console.log(responseData);

  return (
    <div>
      {responseData ? (
        <>
          <p>Response Data: {JSON.stringify(responseData)}</p>
          <img
            src="data:image/jpeg;base64,"
            alt="Angular"
          />
        </>
      ) : (
        <div style={{width:'300px', height:'300px'}}>
          
          <img
            src="data:image/jpeg;base64,"
            alt="Angular"
          />
        </div>
      )}
    </div>
  );
}

export default VirtualNin;
